    #define CENTER_X 15.5
    #define CENTER_Y 15.5
    #define SQ(x) ((x)*(x))
    #define DIST_SQ(x, y) (SQ((x) - CENTER_X) + SQ((y) - CENTER_Y))

    /* Pre-calculated distances squared for efficiency */
    #define R1_SQ (12.0 * 12.0) // Outer white
    #define R2_SQ (9.0 * 9.0)   // Black
    #define R3_SQ (6.0 * 6.0)   // White
    #define R4_SQ (3.0 * 3.0)   // Black
