    #define COLOR(x, y) \
        (DIST_SQ(x, y) > R1_SQ ? 0xFFFF : \
         (DIST_SQ(x, y) > R2_SQ ? 0x0000 : \
          (DIST_SQ(x, y) > R3_SQ ? 0xFFFF : \
           (DIST_SQ(x, y) > R4_SQ ? 0x0000 : 0xFFFF))))

    #define ROW(y) \
        COLOR(0, y), COLOR(1, y), COLOR(2, y), COLOR(3, y), COLOR(4, y), COLOR(5, y), COLOR(6, y), COLOR(7, y), \
